const mainReducer = (state = {
    result: 1,
    lastValuse: []
} ,action) =>{
    switch(action.type){
        case "LOAD_CARS": 
            state = {
                ...state,
                cars: action.car_datas,
            };
            break;
            
    }
    return state;
};
export default mainReducer;
